import '../styles/components-style/ContainerCards.css';


import Location from "../Components/Location"

function ContainerCards(){
    return(
        <div className='containerSection'>
           <ul className='listCard'>
           <Location />
           </ul>
        </div>
    )
}

export default ContainerCards;
